import React from 'react';

const PropertyCard = ({ property }) => {
  const { image, title, location, price, area } = property;

  return (
    <div className="relative overflow-hidden rounded-[20px] aspect-[16/10] group cursor-pointer">
      {/* Image */}
      <img
        src={image}
        alt={title}
        className="w-full h-full object-cover"
      />

      {/* Dark gradient overlay */}
      <div className="absolute inset-0 bg-gradient-to-t from-[#00513B] via-[#00513B]/50 to-transparent" />

      {/* Content */}
      <div className="absolute inset-0 p-6 flex flex-col justify-between">
        {/* Top content - Title and Price */}
        <div className="flex justify-between items-start">
          <h3 className="text-white text-2xl font-semibold max-w-[60%] leading-tight">
            {title}
          </h3>
          <span className="text-white text-3xl font-semibold">
            {price}
          </span>
        </div>

        {/* Bottom content - Location and Area */}
        <div className="flex justify-between items-center pt-4 mt-auto border-t border-white/20">
          <p className="text-white text-lg">
            {location}
          </p>
          <p className="text-white text-lg">
            {area}
          </p>
        </div>
      </div>
    </div>
  );
};

export default PropertyCard;
